// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "./interface/ISimpleERC20.sol";
import "./interface/ICompound.sol";
import "./interface/ISavingsPool.sol";

contract SavingsPool is ISavingsPool {
    address[] public participants;
    mapping (address => uint256) public balances;

    uint256 private constant MAX_INT = 2**256 - 1;

    uint256 public poolBalance;

    ISimpleERC20 public poolToken;
    ICompound public tokenCompound;

    address public owner;
    address public beneficiary;

    bool private initialized;

    modifier onlyOwner() {
        require(owner == msg.sender, "NotOwner");
        _;
    }

    function initialize(address beneficiary_, address token_, address compound_) override external {
        require(!initialized, "AlreadyInitialized");

        poolToken = ISimpleERC20(token_);
        tokenCompound = ICompound(compound_);
        beneficiary = beneficiary_;

        owner = msg.sender;

        if (address(tokenCompound) != address(0)) {
            poolToken.approve(address(tokenCompound), MAX_INT);
        }

        initialized = true;
    }

    function participate(address user, uint256 amount) external onlyOwner override {
        poolToken.transferFrom(user, address(this), amount);

        poolBalance += amount;

        if (address(tokenCompound) != address(0)) {
            tokenCompound.mint(amount);
        }

        participants.push(user);
        balances[user] += amount;
    }

    function claim(address user) external onlyOwner override {
        require(user == beneficiary, "NotBeneficiary");

        // Liquidate everything
        if (address(tokenCompound) != address(0)) {
            uint256 compoundBalance = tokenCompound.balanceOf(address(this));
            if (compoundBalance != 0) {
                require(0 == tokenCompound.redeem(compoundBalance), "CompoundError");
            }
        }
        poolToken.transfer(user, poolToken.balanceOf(address(this)));
    }

    function participantsLength() external view returns(uint256) {
        return participants.length;
    }
}
